import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Create from './Create';
import Add from './Add';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/add" element={<Add/>} />
        <Route path="/create" element={<Create/>} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
